"1.字符识别\n"
"本软件提供字符识别功能，在开始识别之前，请选取识别区域：\n"
"a手动选取\n"
"点击[框选区域]可在监控窗口拖拽鼠标框出标准矩形区域，或点击[点选区域]在监视窗口顺次点击四点绘制四边形区域，所选区域将会以红色线框出。\n"
"b自动选取\n"
"点击[自动搜索]自动框出监控窗口的字符区域，然后可根据需求参考手动选取和删除区域的方法调整所选区域。\n"
"c删除区域\n"
"鼠标点击需要删除的区域，带区域框线变蓝，便可点击[删除区域]按钮删除所选区域。\n"
"待所有区域选取完毕后，即可点击[开始识别]识别所选区域处的字符，并可以在左上角的监视区读取结果，按下[结束识别]则立即结束。\n"
"2.相机控制\n"
"本软件支持各项相机操作，UI初始化后通过[打开相机][关闭相机]控制摄像头，开启相机后，待监控窗口读取到图像方可启动上述检测及识别功能。支持录制与回放，按下[开始录制]即可录制监控区内容，按下[结束录制]即可保存录像到指定路径；点击[查看录制]便可回放指定视频。\n"
"3.数据保存\n"
"本软件提供监测数据保存功能，点击保存数据按钮可定时保存数据到相关文件夹，如有超出阈值报警会进行即时保存，超出阈值异常消失后，恢复定时保存，按下[停止保存]则立即结束数据保存。\n"
"4.异常报警\n"
"本软件提供监测数据超出阈值报警功能，点击开启警报按钮，如有超出阈值报警会立即将绿灯转为绿灯+黄灯闪烁，如报警在1分钟内消失则保持该状态，如报警持续超过1分钟则转为红灯+蜂鸣，所有警报状态均持续到人为关闭警报，并不会随着警报消失而消失，点击关闭警报按钮报警灯转为绿灯。\n"
